        uint256 difference = block.number.sub(_mineInfo[user][1]).add(1);
        uint256 start = blockStatus(_mineInfo[user][1]);
        uint256 end = blockStatus(block.number);
        uint256 a = start.add(end).mul(difference).div(2);

        uint dcf_amount = a.mul(_mineInfo[user][2]).div(_totalPower);
        return _mineInfo[user][3].add(dcf_amount);       
    }
   

    
